import skillsCss from './css.png';
import skillsJquery from './jquery.png';
import skillsXcode from './xcode.png';
import skillsPhotoshop from './photoshop.png';

import myWorkDashboards from './myWorkDashboards.png';
import myWorkWizards from './myWorkWizards.png';
import myWorkApps from './myWorkApps.png';


import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';

function App() {

  return (
    <div className="App">

      <Header />

      <Body />

      <div className="footer" style={{background: "#000", color: "#fff", padding: "5em"}}><h2>Hire me, you know you want to...</h2></div>
    </div>

  );
}

export default App;
